import React, {Component} from 'react'

const TableHeader = () => {
  return (
    <thread>
      <tr>
        <th>first musician</th>
      </tr>
    </thread>
  )
}

const TableBody = (props) => {
  while(columns < 4) {
    const columns = props.characterData.map((column, index) => {
      return (
        <tc key={index}>
          <td>{column.artistName}</td>
          <td>
            <button onClick={() => props.removeCharacter(index)}>Delete</button>
          </td>
        </tc>
      )
    })
  }

  return <tbody>{columns}</tbody>
}

const Table = (props) => {
  const {characterData, removeCharacter} = props

  return (
    <table>
      <TableHeader />
      <TableBody characterData={characterData} removeCharacter={removeCharacter} />
    </table>
  )
}

export default Table
